node.text:
Очень люблю Лагман!!))) Нашла рецепт, может кто ещё любит))) Лагман - популярное среднеазиатское национальное блюдо, а если точнее, то просто густой суп. Его главными составляющими являются мясо, лапша и овощи. Приготовьте обязательно, равнодушных не останется!

Для приготовления вкуснейшего лагмана потребуется:
1,5 литра мясного бульона;
500 г телятины;
300 г лапши;
2 сладких перца;
2 больших помидора;
1 большая луковица;
2-3 зубчика чеснока;
маленький пучок петрушки;
3-4 ст. л. растительного масла;
соль, свежемолотый черный перец.

Перец, помидоры, лук очистить и нарезать кубиками. Мясо нарезать небольшими кубиками.

В глубокой сковороде сильно разогреть растительное масло. На сильном огне обжарить мясо (лучше порционно, чтобы мясо не тушилось, а жарилось). Затем готовое мясо выложить в тарелку. 
Когда всё мясо готово, вернуть его в сковороду. Добавить овощи, жарить помешивая, 5-7 минут. 
Затем влить теплый бульон, довести до кипения, уменьшить огонь до среднего и варить до готовности (около часа). Петрушку и чеснок мелко порубить. За минут 10 до готовности мяса, отварите лапшу в соответствии с инструкцией на упаковке. Готовую лапшу откинуть на дуршлаг. В глубокие тарелки положить лапшу, влить суп, посыпать чесноком и петрушкой.

Подавайте наивкуснейший лагман очень горячим!
Приятного аппетита!
